import App from "next/app";

class MyApp extends App {
  render() {
    const { Component, pageProps } = this.props;

    return (
      <div>
        <Component {...pageProps} />
        <style jsx global>{`
          @font-face {
            font-family: "Georgia";
            src: url("/assets/fonts/georgia/georgia.ttf");
            font-weight: normal;
            font-style: normal;
            font-display: swap;
          }
          @font-face {
            font-family: "Georgia Bold";
            src: url("/assets/fonts/georgia/georgiab.ttf");
            font-weight: bold;
            font-style: normal;
            font-display: swap;
          }
          @font-face {
            font-family: "Georgia Italic";
            src: url("/assets/fonts/georgia/georgiai.ttf");
            font-weight: normal;
            font-style: italic;
            font-display: swap;
          }
          @font-face {
            font-family: "Georgia Z";
            src: url("/assets/fonts/georgia/georgiaz.ttf");
            font-weight: bold;
            font-style: normal;
            font-display: swap;
          }
          @font-face {
            font-family: "Graphik Medium Italic";
            src: url("/assets/fonts/Graphik/GraphikMediumItalic.otf");
            font-weight: bold;
            font-style: normal;
            font-display: swap;
          }
        `}</style>
      </div>
    );
  }
}

export default MyApp;
